import React from 'react'
import { Card } from 'react-bootstrap'
import { Link } from 'react-router-dom'

const Trailer = ({movie}) => {
return (
    <header>
        <Card>
    <Card.Body>{movie.trailer}</Card.Body>
</Card>

    </header>
)
}

export default Trailer
